import React from "react";
import { Link } from "react-router-dom";
//import image
import ItemImg from "../assets/img/card-item-3.jpg";
//import icon
function Card() {
  return (
    <div>
      <article>
        <div className="col-md-4">
          <div className="post">
            <Link id="MedImg" to={`/blog-post/`} className="post-img">
              <img src={ItemImg} alt="img" />
            </Link>
            <div className="post-body">
              <div className="post-meta">
                <Link to="/category" className="post-category cat-1">
                  type
                </Link>
                <span className="post-date">date</span>
              </div>
              <h3 className="post-title">
                <Link to={`/blog-post/`}>link</Link>
              </h3>
            </div>
          </div>
        </div>
      </article>
    </div>
  );
}

export default Card;
